import Banner from '../../components/Banner'
import styled from 'styled-components'
import { Link } from 'react-router-dom'
import Card from '../../components/Card'
import logements from '../../assets/logements.json'

const HomeContainer = styled.div`
  width: 100vw;
  height: 23vh;
  max-height: 1095px;
`
const CardsContainer = styled.div`
  width: 90%;
  max-width: 1240px;
  height: 90%;
  max-height: 829px;
  display: flex;

  align-items: center;
  justify-items: center;
`
function Home() {
  return (
    <HomeContainer>
      <Banner />
      <CardsContainer>
        {logements &&
          logements.map((logement) => {
            return (
              <Link>
                <CardImage
                  key={logement.id}
                  src={logement.cover}
                  alt="logement"
                />
              </Link>
            )
          })}
      </CardsContainer>
    </HomeContainer>
  )
}

export default Home
